
value_history_1:
  id: 1
  setting_id: 1
  invoicing_profile_id: 1
  value: '<p>Le Fab Lab de <a href="http://lacasemate.fr" target="_blank">La Casemate</a>
    est un atelier de fabrication numérique où l’on peut utiliser des machines de
    découpe, des imprimantes 3D,… permettant de travailler sur des matériaux variés
    : plastique, bois, carton, vinyle, … afin de créer toute sorte d’objet grâce à
    la conception assistée par ordinateur ou à l’électronique.  Mais le Fab Lab est
    aussi un lieu d’échange de compétences technique. </p> <p>Le Fab Lab de <a href="http://lacasemate.fr"
    target="_blank">La Casemate</a> est un espace permanent : ouvert à tous, il offre
    la possibilité de réaliser des objets soi-même, de partager ses compétences et
    d’apprendre au contact des médiateurs du Fab Lab et des autres usagers. </p><p>La
    formation au Fab Lab s’appuie sur des projets et le partage de connaissances :
    vous devez prendre part à la capitalisation des connaissances et à l’instruction
    des autres utilisateurs.</p>'
  created_at: 2018-12-17 11:23:01.224566000 Z
  updated_at: 2018-12-17 11:23:01.224566000 Z
